import React from 'react';
import { increment,decrement } from '../Redux/actions/ReduxAction';
import { useSelector,useDispatch } from 'react-redux';
export default function Counter() {
  const val=useSelector((state)=>state.val)
  const usedispath=useDispatch()
  return (
    <div>
     
       <button onClick={()=>usedispath(increment)}>Increase</button>
       <div>{val}</div>
       <button onClick={()=>usedispath(increment)}>Decrease</button>
    </div>
  )
}
